> async function formatAngka(angka) {
    if (angka < 1000) {
        return angka.toString();
    } else if (angka < 1000000) {
        return `${Math.floor(angka / 1000)} Ribuan ${await formatAngka(angka % 1000)}`;
    } else if (angka < 1000000000) {
        return `${Math.floor(angka / 1000000)} Juta ${await formatAngka(angka % 1000000)}`;
    } else if (angka < 1000000000000) {
        return `${Math.floor(angka / 1000000000)} Miliar ${await formatAngka(angka % 1000000000)}`;
    } else {
        return `${Math.floor(angka / 1000000000000)} Triliun ${await formatAngka(angka % 1000000000000)}`;
    }
}

async function main() {
    const angka = 266839989;
    const hasilFormat = await formatAngka(angka);
    console.log(hasilFormat);
}

main();

