> async function formatAngka(angka) {
    if (angka < 1000) {
        return `${angka} Perak`;
    } else if (angka < 1000000) {
        return `${Math.floor(angka / 1000)} Ribu ${angka % 1000} Perak`;
    } else if (angka < 1000000000) {
        return `${Math.floor(angka / 1000000)} Juta ${Math.floor((angka % 1000000) / 1000)} Ribu ${angka % 1000} Perak`;
    } else if (angka < 1000000000000) {
        return `${Math.floor(angka / 1000000000)} Miliar ${Math.floor((angka % 1000000000) / 1000000)} Juta ${Math.floor((angka % 1000000) / 1000)} Ribu ${angka % 1000} Perak`;
    } else {
        return "Terlalu besar untuk diformat.";
    }
}

async function main() {
    const angka = 266839989;
    const hasilFormat = await formatAngka(angka);
    m.reply(hasilFormat);
}

main();
